import React from "react";
import { useAuth0, withAuthenticationRequired } from "@auth0/auth0-react";
import Loading from './Loading';
import $ from 'jquery';

const Profile = () => {
  const { user } = useAuth0();
  var settings = {
    "async": true,
    "crossDomain": true,
    "url": "https://dev-royzhu.us.auth0.com/oauth/token",
    "method": "POST",
    "headers": {
      "content-type": "application/json"
    },
    "data": "{\"client_id\":\"wRJEcBy466MQx6VeQzzem1kSYs3CxpCG\",\"client_secret\":\"j4_LNPv5ZHu84npfobtWkCokt-dmrDlbwCIk54j1IFyc3W6DeiUUvLt_sO28W-ZP\",\"audience\":\"boardgameforum\",\"grant_type\":\"client_credentials\"}"
  }

  $.ajax(settings).done(function (response) {
    console.log(response["access_token"])
    sessionStorage.setItem("token", response["access_token"]);
  });

  return (
    <div>
      <div className="row align-items-center profile-header">
        <div className="col-md-2 mb-3">
          <img
            src={user.picture}
            alt="Profile"
            className="rounded-circle img-fluid profile-picture mb-3 mb-md-0"
          />
        </div>
        <div className="col-md text-center text-md-left">
          <h2>{user.name}</h2>
          <p className="lead text-muted">{user.email}</p>
        </div>
      </div>
      <div className="row">
        <pre className="col-12 text-light bg-dark p-4">
          {JSON.stringify(user, null, 2)}
        </pre>
      </div>
    </div>
  );
};

export default withAuthenticationRequired(Profile, {
  returnTo: () => window.location.hash.substr(1),
  onRedirecting: () => <Loading />,
});
